package com.example.entity;import com.example.entity.Base.StringBaseEntity;import jakarta.persistence.*;import jdk.jfr.Enabled;import lombok.Getter;import lombok.Setter;@Setter@Getter@Entity@Table(name = "video_tag")public class VideoTagEntity extends StringBaseEntity {    @Column(name = "video_id")    private String videoId;    @ManyToOne    @JoinColumn(name = "video_id", insertable = false, updatable = false)    private VideoEntity video;    @Column(name = "tag_id")    private Integer tagId;    @OneToOne    @JoinColumn(name = "tag_id", insertable = false, updatable = false)    private TagEntity tagEntity;}